import React, { Component } from 'react';
import { Text, View } from 'react-native';

class DeleteConntactScreen extends Component {
  constructor(props) {
    super(props);
    this.state = {
      email: '',
      user_id: '',
     };
    }






    render() {
      return (
        <View>
          <Text>This is the Add Contacts screen</Text>
          <TextInput
            placeholder="Enter The Email Of The Person You Want To Delete"
            onChangeText={(email) => this.setState({ email })}
            value={this.state.email}
            style={{
              padding: 10,
              borderWidth: 2,
              borderRadius: 5,
              margin: 10,
            }}
          />
  
          <Button title="Add Contact" onPress={() => this.AddUser()} />
        </View>
      );
    }

}

export default DeleteConntactScreen;
